import React, { useEffect, useState } from 'react';
import axios from 'axios';

const WinnerDisplay = () => {
  const [winner, setWinner] = useState(null);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/history/', { headers: { Authorization: `Bearer ${localStorage.getItem('access_token')}` } })
      .then(response => {
        const latest = response.data[0];
        if (latest) {
          setWinner(latest.winner);
        }
      })
      .catch(error => console.error('Error fetching winner history', error));
  }, []);

  return (
    <div>
      <h1>Today's Winner</h1>
      {winner ? <div>{winner.name}</div> : <div>No winner yet</div>}
    </div>
  );
};

export default WinnerDisplay;
